from typing import List
import math
import collections

class Solution:
    def minimumCardPickup(self, cards: List[int]) -> int:
        ans = math.inf
        last = collections.defaultdict(int)
        for i, x in enumerate(cards):
            if last[x] > 0:
                ans = min(ans, i - last[x] + 2)
            last[x] = i + 1
        return ans if ans < math.inf else -1
